        originální obal - vše na svém místě.
Condition - Overall [0] (hint):
    static: true
    value:
        Celkový stav by bylo fajn vyplnit, jinak hrozí, že váš inzerát zapadne
        mezi ostatními.
Condition - Overall [1] (hint):
    static: true
    value:
        Předmět nabídky již neplní svou funkci, nicméně je možné jej použít buď
        na náhradní díly nebo jiným dílem opět uvést do provozu. Obecně vyžaduje
        zručnost na straně kupujícího.
Condition - Overall [2] (hint):
    static: true
    value: Předmět nabídky plní svou funkci, nicméně je poškozen a obecně může
        vyžadovat opravdu nebo zručnost na straně kupujícího.
Condition - Overall [3] (hint):
    static: true
    value: Průměrné opotřebení relativní k věku předmětu. Obecně tak lze označit
        věci, které by bez větší údržby ještě nějakou dobu měly sloužit.
Condition - Overall [4] (hint):
    static: true
    value:
        Obecně perfektní stav s malým opotřebením. Známky použití mohou být znát,
        ale minimálně. Např. půl roku starý telefon bez rozmláceného displaye.
Condition - Overall [5] (hint):
    static: true
    value: Takto označte věci, které jsou zbrusu nové, mají veškeré náležité
        příslušenství a originální obal.
